    def countOperationsToEmptyArray(self, nums: List[int]) -> int:
        N = len(nums)
        snums = sorted(nums)
        cnt = 0


        dq1 = deque(sorted(nums))
        dq2 = deque(nums)
        cnt = 0
        i = 0
        while i < N:
            if dq2[0] == dq1[i]:
                i += 1
                dq2.popleft()
            else:
                n = dq2.popleft()
                dq2.append(n)
            cnt += 1
        return cnt


